import { useState } from "react"

/* eslint-disable jsx-a11y/alt-text */
function Image(){
    // eslint-disable-next-line no-unused-vars
    const [img,setImg]=useState('https://www.google.com/search?q=javascript+img&tbm=isch&ved=2ahUKEwjss6mrpY7_AhUdFLcAHR4tCuQQ2-cCegQIABAA&oq=javascript+img&gs_lcp=CgNpbWcQAzIJCAAQGBCABBAKMgcIABAYEIAEMgcIABAYEIAEMgkIABAYEIAEEAoyBwgAEBgQgAQyBwgAEBgQgAQyBwgAEBgQgAQyBwgAEBgQgAQyCQgAEBgQgAQQCjIJCAAQGBCABBAKOgQIIxAnOgYIABAIEB46CggAEIoFELEDEEM6BwgAEIoFEEM6BQgAEIAEOgYIABAHEB5QlQ9Ynb4BYNa_AWgAcAB4AIABvgSIAb4SkgEMMC4xMC4wLjEuMC4xmAEAoAEBqgELZ3dzLXdpei1pbWfAAQE&sclient=img&ei=GTBuZKzDA52o3LUPntqooA4&bih=601&biw=1225#imgrc=OYQ59qpDUQL6MM')
    const javascript=()=>{
        setImg('https://www.bing.com/images/search?view=detailV2&ccid=PHBTJosh&id=8EBF89F2763C68ADB9AC978680C5B23512F820FC&thid=OIP.PHBTJoshbg880IH9z_PB6QHaHa&mediaurl=https%3a%2f%2fwww.britefish.net%2fwp-content%2fuploads%2f2019%2f06%2flogo-javascript-2.png&cdnurl=https%3a%2f%2fth.bing.com%2fth%2fid%2fR.3c7053268b216e0f3cd081fdcff3c1e9%3frik%3d%252fCD4EjWyxYCGlw%26pid%3dImgRaw%26r%3d0&exph=2000&expw=2000&q=javascript&simid=607996176502365520&FORM=IRPRST&ck=DE94A4621E07E5C3B3E68E418A4AF259&selectedIndex=2&ajaxhist=0&ajaxserp=0')
    }
    const react=()=>{
        setImg('https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fa%2Fa7%2FReact-icon.svg&tbnid=3yb309DfyvIz2M&vet=12ahUKEwjss6mrpY7_AhUdFLcAHR4tCuQQMygBegUIARDAAQ..i&imgrefurl=https%3A%2F%2Fcommons.wikimedia.org%2Fwiki%2FFile%3AReact-icon.svg&docid=nfz2qKo0MFLwMM&w=800&h=696&q=react%20img&ved=2ahUKEwjss6mrpY7_AhUdFLcAHR4tCuQQMygBegUIARDAAQ')
    }
    const Ctwoplus=()=>{
        setImg('https://www.bing.com/images/search?view=detailV2&ccid=lzUhh3cM&id=25C24BA1F450346C8EC1E80EC05786E41AE1611C&thid=OIP.lzUhh3cMIyqgUJcdtzvMjgHaFj&mediaurl=https%3a%2f%2fth.bing.com%2fth%2fid%2fR.97352187770c232aa050971db73bcc8e%3frik%3dHGHhGuSGV8AO6A%26riu%3dhttp%253a%252f%252fwww.pngall.com%252fwp-content%252fuploads%252f2016%252f05%252fC-PNG-Image.png%26ehk%3d9aPOWvmyJL5J0fuNb0eTgQlem3IehdX8m3kxWwYnIpM%253d%26risl%3d%26pid%3dImgRaw%26r%3d0&exph=3000&expw=4000&q=C%2b%2b+imgae&simid=608043545695574004&FORM=IRPRST&ck=2146B7AF9B072C77A8F7C601835AD37E&selectedIndex=0')
    }
    
    return(
        <div>
            <img src={img} height='100px' width='100px'/>
            <button onClick={react}>React</button>
            <button onClick={javascript}>javascript</button>
            <button onClick={Ctwoplus}>C++</button>

        </div>
    )
}
export default Image
